import React from 'react';

function Main() {
    return (
       <div className='thanks active'>
        <div className='thanks__container'>
            <img src='img/suitable.svg' alt=''></img>
            <p className='thanks__title'>Спасибо!</p>
            <p>Мы&nbsp;свяжемся с&nbsp;тобой в&nbsp;скором времени</p>
        </div>
       </div>
    );
}

export default Main;
